  false,\n\t\"url\": null,\n\t\"notes\": \"Phytoplankton and other data were collected
  in the Antarctic from the NATHANIEL B. PALMER and ROGER REVELL from 17 October 1996
  to 15 March 1998. Bottle data include enumeration and counts of bacteria, picoplankton,
  nanoplankton and nano microplankton. Bottle data also include concentrations of
  trace metals. CTD data include conductivity, temperature, and salinity profiles.
  Data were collected in support of the US Joint Global Ocean Flux Study / Antarctic
  Environments Southern Ocean Process Study (JGOFS/AESOPS).\",\n\t\"license_title\":
